import React from 'react'
import one from '../media/01.mp3'
import two from '../media/02.mp3'

const data = [
{
	id: '01',
	src: one,
},
{
	id: '02',
	src: two,
}];

const List = () => (
  <ul>
    {data.map(item => (
      <div key={item.id} id='songs'>
        <div>{item.id}</div>
        <audio id='audio' controls src={item.src}></audio>
        <div id="canvas">
				<AudioSpectrum
				  id="audio-canvas"
				  height={200}
				  width={10000}
				  audioId={'audio'}
				  capColor={CSS_COLOR_NAMES[Math.floor(Math.random() * 141)]}
				  capHeight={1}
				  meterWidth={33}
				  meterCount={64}
				  meterColor={[
				    {stop: 0, color: CSS_COLOR_NAMES[Math.floor(Math.random() * 141)]},
				    {stop: 0.5, color: CSS_COLOR_NAMES[Math.floor(Math.random() * 141)]},
				    {stop: 1, color: CSS_COLOR_NAMES[Math.floor(Math.random() * 141)]}
				  ]}
				  gap={2}
				/>
				</div>
      </div>
    ))}
  </ul>
);


export default function Tracks(props) {
	return (
		<div>
			<div className='title'>
				<h2>Tracks</h2>
			</div>
			<List />
		</div>
		)
}
